define({"topics" : [{"title":"Schema and Table Name Patterns","shortdesc":"\n                  <p class=\"shortdesc\">You define the group of tables that the Teradata Consumer origin reads by defining         schema and table name patterns\n                     for the table configuration. The origin reads all tables with         names that match the table pattern in the schemas with\n                     names that match the schema pattern. \n                  </p>\n               ","href":"datacollector\/UserGuide\/Origins\/Teradata.html#concept_ank_41x_4y","attributes": {"data-id":"concept_ank_41x_4y",},"menu": {"hasChildren":false,},"tocID":"concept_ank_41x_4y-d46e88556","topics":[]},{"title":"Offset Column and Value","shortdesc":"\n                  <p class=\"shortdesc\">The Teradata Consumer origin uses an offset column and initial offset value to determine         where to start reading data\n                     within tables and partitions.\n                  </p>\n               ","href":"datacollector\/UserGuide\/Origins\/Teradata.html#concept_yfx_mhx_4y","attributes": {"data-id":"concept_yfx_mhx_4y",},"menu": {"hasChildren":false,},"tocID":"concept_yfx_mhx_4y-d46e88642","topics":[]},{"title":"Reading from Views","shortdesc":"\n                  <p class=\"shortdesc\">The Teradata Consumer origin can read from views in addition to tables. </p>\n               ","href":"datacollector\/UserGuide\/Origins\/Teradata.html#concept_m43_zzm_dbb","attributes": {"data-id":"concept_m43_zzm_dbb",},"menu": {"hasChildren":false,},"tocID":"concept_m43_zzm_dbb-d46e88738","topics":[]}]});